import React from "react";

export default function Home() {
  return (
    <div className="row">
      <div className="col col-12">
        <h1>Forside</h1>
        <div className="card" style={{ overflow: "hidden", width: "50%" }}>
          <div className="card-body">
            <a onClick={redirect.bind(this)} data-device-id="1">
              Forside
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}
